import React, { useState } from 'react';
import { Box, Typography, Card, CardContent, Collapse, IconButton, Button } from '@mui/material';
import { styled } from '@mui/material/styles';
import PsychologyIcon from '@mui/icons-material/Psychology';
import PeopleIcon from '@mui/icons-material/People';
import ChildCareIcon from '@mui/icons-material/ChildCare';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import ExpandLessIcon from '@mui/icons-material/ExpandLess';

const ServicesContainer = styled(Box)(({ theme }) => ({
  padding: '80px 20px',
  backgroundColor: 'white',
}));

const StyledCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  padding: '20px',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-10px)',
  },
}));

const IconWrapper = styled(Box)(({ theme }) => ({
  color: '#dbe5ce',
  fontSize: '48px',
  marginBottom: '20px',
}));

const ExpandButton = styled(IconButton)(({ theme }) => ({
  marginTop: '10px',
  color: '#2E7D32',
}));

const Services = () => {
  const [expanded, setExpanded] = useState<number | null>(null);

  const handleExpandClick = (index: number) => {
    setExpanded(expanded === index ? null : index);
  };

  const services = [
    {
      icon: <PsychologyIcon sx={{ fontSize: 48 }} />,
      title: 'Psicoterapia Individual',
      description: 'Caminhos para o autoconhecimento e equilíbrio emocional.',
      details: [
        'Avaliação psicológica completa',
        'Tratamento personalizado',
        'Abordagem Cognitivo-Comportamental',
        'Desenvolvimento de estratégias de enfrentamento',
        'Acompanhamento contínuo'
      ],
      link: '/individual-therapy'
    },
    {
      icon: <PeopleIcon sx={{ fontSize: 48 }} />,
      title: 'Terapia para Jovens',
      description: 'Apoio emocional para enfrentar desafios da adolescência.',
      details: [
        'Avaliação do desenvolvimento',
        'Orientação vocacional',
        'Gestão de emoções',
        'Desenvolvimento de habilidades sociais',
        'Apoio familiar'
      ],
      link: '/youth-therapy'
    },
    {
      icon: <ChildCareIcon sx={{ fontSize: 48 }} />,
      title: 'Psicologia Infantil',
      description: 'Cuidado especializado para o desenvolvimento emocional das crianças.',
      details: [
        'Avaliação do desenvolvimento infantil',
        'Terapia lúdica',
        'Orientação parental',
        'Desenvolvimento de habilidades sociais',
        'Acompanhamento escolar'
      ],
      link: '/child-therapy'
    },
  ];

  return (
    <ServicesContainer id="services">
      <Typography variant="h3" component="h2" align="center" gutterBottom sx={{ color: '#1B5E20', mb: 6 }}>
        Nossos Serviços
      </Typography>
      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 4, justifyContent: 'center' }}>
        {services.map((service, index) => (
          <Box 
            key={index}
            sx={{ 
              flex: { 
                xs: '1 1 100%', 
                sm: '1 1 calc(50% - 16px)', 
                md: '1 1 calc(33.333% - 22px)' 
              },
              maxWidth: { 
                xs: '100%', 
                sm: 'calc(50% - 16px)', 
                md: 'calc(33.333% - 22px)' 
              }
            }}
          >
            <StyledCard>
              <IconWrapper>{service.icon}</IconWrapper>
              <CardContent>
                <Typography variant="h5" component="h3" gutterBottom align="center" sx={{ color: '#2E7D32' }}>
                  {service.title}
                </Typography>
                <Typography variant="body1" align="center" color="text.secondary">
                  {service.description}
                </Typography>
                <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
                  <ExpandButton
                    onClick={() => handleExpandClick(index)}
                    aria-expanded={expanded === index}
                    aria-label="mostrar mais"
                  >
                    {expanded === index ? <ExpandLessIcon /> : <ExpandMoreIcon />}
                  </ExpandButton>
                </Box>
                <Collapse in={expanded === index} timeout="auto" unmountOnExit>
                  <Box sx={{ mt: 2 }}>
                    <Typography variant="body2" color="text.secondary" paragraph>
                      Benefícios incluem:
                    </Typography>
                    <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
                      {service.details.map((detail, i) => (
                        <li key={i} style={{ marginBottom: '8px', color: '#2E7D32' }}>
                          • {detail}
                        </li>
                      ))}
                    </ul>
                    <Button
                      variant="contained"
                      color="primary"
                      fullWidth
                      sx={{ mt: 2, backgroundColor: '#2E7D32' }}
                      href={service.link}
                    >
                      Saiba mais
                    </Button>
                  </Box>
                </Collapse>
              </CardContent>
            </StyledCard>
          </Box>
        ))}
      </Box>
    </ServicesContainer>
  );
};

export default Services;
